"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[9217],{2366:(a,e,r)=>{r.r(e),r.d(e,{default:()=>t});var o=r(8e3);const n=[(0,o.uE)('<p>El presente material elaborado por ERPyA, pretende ofrecerle una explicación eficiente a nuestros clientes del procedimiento a seguir para registrar en ADempiere un almacén, en su versión 3.9.2 para la localización Venezuela.</p><ul><li>Registro de Almacén</li><li>Ubicación</li></ul><h2 id="registro-de-almacen" tabindex="-1"><a class="header-anchor" href="#registro-de-almacen" aria-hidden="true">#</a> Registro de Almacén</h2><p>Ubique y seleccione en el menú de ADempiere, la carpeta <strong>Gestión de Materiales</strong>, luego seleccione la carpeta <strong>Reglas de Gestión de Materiales</strong>, por último seleccione la ventana <strong>Almacén y Ubicaciones</strong>.</p><p><img src="/assets/img/docs/master-data/mad-master-image229.png" alt="Icono Guardar Cambios"></p><p>Imagen 1. Menú de ADempiere</p><p>Podrá visualizar la ventana <strong>Almacén y Ubicaciones</strong>, con los diferentes registros de almacenes creados en ADempiere con sus respectivas ubicaciones.</p><p><img src="/assets/img/docs/master-data/mad-master-image230.png" alt="Icono Guardar Cambios"></p><p>Imagen 2. Ventana Almacén y Ubicaciones</p><p>Seleccione el icono <strong>Registro Nuevo</strong>, ubicado en la barra de herramientas de ADempiere.</p><p>Este icono permite crear un nuevo registro en la ventana, para proceder al llenado de los campos correspondientes.</p><p><img src="/assets/img/docs/master-data/mad-master-image231.png" alt="Icono Guardar Cambios"></p><p>Imagen 3. Icono Registro Nuevo</p><p>En el campo <strong>Organización</strong>, se debe seleccionar la organización para la cual se encuentra creando el registro del almacén.</p><p><img src="/assets/img/docs/master-data/mad-master-image232.png" alt="Icono Guardar Cambios"></p><p>Imagen 4. Campo Organización</p><p>Introduzca en el campo <strong>Código</strong>, el código del almacén que se encuentra registrando.</p><p><img src="/assets/img/docs/master-data/mad-master-image233.png" alt="Icono Guardar Cambios"></p><p>Imagen 5. Campo Código</p><p>Introduzca en el campo <strong>Nombre</strong>, el nombre del almacén que se encuentra registrando.</p><p><img src="/assets/img/docs/master-data/mad-master-image234.png" alt="Icono Guardar Cambios"></p><p>Imagen 6. Campo Nombre</p><p>Introduzca en el campo <strong>Descripción</strong>, una breve descripción del almacén que se encuentra registrando.</p><p><img src="/assets/img/docs/master-data/mad-master-image235.png" alt="Icono Guardar Cambios"></p><p>Imagen 7. Campo Descripción</p><p>Seleccione en el campo <strong>Localización / Dirección</strong>, la dirección de localización del almacén que se encuentra registrando.</p><p><img src="/assets/img/docs/master-data/mad-master-image236.png" alt="Icono Guardar Cambios"></p><p>Imagen 8. Campo Localización / Dirección</p><p>El campo <strong>Separador Elemento de Cuentas</strong>, indica el separador del elemento de las cuentas.</p><p><img src="/assets/img/docs/master-data/mad-master-image237.png" alt="Icono Guardar Cambios"></p><p>Imagen 9. Campo Separador Elemento de Cuentas</p><p>Seleccione en el campo <strong>Almacén Fuente</strong>, el almacén fuente al cual pertence el almacén que se encuentra registrando.</p><p>Este campo no es obligatorio y se debe seleccionar solo cuando el almacén en cuestión, posea un almacén fuente.</p><p><img src="/assets/img/docs/master-data/mad-master-image238.png" alt="Icono Guardar Cambios"></p><p>Imagen 10. Campo Almacén Fuente</p><p>Introduzca en el campo <strong>Clase Reabastecimiento</strong>, la clase para el reabastecimiento del almacén que se encuentra registrando.</p><p><img src="/assets/img/docs/master-data/mad-master-image239.png" alt="Icono Guardar Cambios"></p><p>Imagen 11. Campo Clase Reabastecimiento</p><p>Seleccione el icono <strong>Guardar Cambios</strong>, para guardar el registro de los campos de la ventana <strong>Almacén y Ubicaciones</strong>.</p><p><img src="/assets/img/docs/master-data/mad-master-image240.png" alt="Icono Guardar Cambios"></p><p>Imagen 12. Icono Guardar Cambios</p><h2 id="ubicacion" tabindex="-1"><a class="header-anchor" href="#ubicacion" aria-hidden="true">#</a> Ubicación</h2><p>Seleccione del lado izquierdo de la ventana <strong>Almacén y Ubicaciones</strong>, la pestaña <strong>Ubicación</strong> y proceda al llenado de los campos correspondientes.</p><p><img src="/assets/img/docs/master-data/mad-master-image241.png" alt="Icono Guardar Cambios"></p><p>Imagen 13. Pestaña Ubicación</p><p>Introduzca en el campo <strong>Código</strong>, el código de la ubicación que se encuentra registrando.</p><p><img src="/assets/img/docs/master-data/mad-master-image242.png" alt="Icono Guardar Cambios"></p><p>Imagen 14. Campo Código</p><p>Introduzca en el campo <strong>Prioridad Relativa</strong>, la prioridad relativa del producto.</p><p>La prioridad relativa indica la ubicación desde la que se va a seleccionar primero un producto si se encuentra almacenado en más de una ubicación</p><p><img src="/assets/img/docs/master-data/mad-master-image243.png" alt="Icono Guardar Cambios"></p><p>Imagen 15. Campo Prioridad Relativa</p><p>Seleccione el check <strong>Predeterminado</strong>, para indicar que el registro será usado como un valor predeterminado.</p><p><img src="/assets/img/docs/master-data/mad-master-image244.png" alt="Icono Guardar Cambios"></p><p>Imagen 16. Check Predeterminado</p><p>Introduzca en el campo <strong>Rack</strong>, el pasillo donde está localizado el producto.</p><p><img src="/assets/img/docs/master-data/mad-master-image245.png" alt="Icono Guardar Cambios"></p><p>Imagen 17. Campo Rack</p><p>Introduzca en el campo <strong>Columna</strong>, el anaquel donde está localizado el producto.</p><p><img src="/assets/img/docs/master-data/mad-master-image246.png" alt="Icono Guardar Cambios"></p><p>Imagen 18. Campo Columna</p><p>Introduzca en el campo <strong>Nivel</strong>, el nivel donde está localizado el producto.</p><p><img src="/assets/img/docs/master-data/mad-master-image247.png" alt="Icono Guardar Cambios"></p><p>Imagen 19. Campo Nivel</p><p>Seleccione el icono <strong>Guardar Cambios</strong>, para guardar el registro de los campos de la pestaña <strong>Ubicación</strong>, de la ventana <strong>Almacén y Ubicaciones</strong>.</p><p><img src="/assets/img/docs/master-data/mad-master-image248.png" alt="Icono Guardar Cambios"></p><p>Imagen 20. Icono Guardar Cambios</p>',67)],s={},t=(0,r(3860).Z)(s,[["render",function(a,e){return(0,o.wg)(),(0,o.iD)("div",null,n)}]])},5881:(a,e,r)=>{r.r(e),r.d(e,{data:()=>o});const o=JSON.parse('{"key":"v-450e774b","path":"/docs/master-data/warehouse.html","title":"Almacén","lang":"en-US","frontmatter":{"title":"Almacén","category":["Documentation"],"star":9,"sticky":9,"article":false,"summary":"El presente material elaborado por ERPyA, pretende ofrecerle una explicación eficiente a nuestros clientes del procedimiento a seguir para registrar en ADempiere un almacén, en su ","head":[["meta",{"property":"og:url","content":"https://docs-md.erpya.com/docs/master-data/warehouse.html"}],["meta",{"property":"og:title","content":"Almacén"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2023-05-03T16:21:37.000Z"}],["meta",{"property":"og:locale","content":"en-US"}],["meta",{"property":"article:modified_time","content":"2023-05-03T16:21:37.000Z"}]]},"excerpt":"","headers":[{"level":2,"title":"Registro de Almacén","slug":"registro-de-almacen","children":[]},{"level":2,"title":"Ubicación","slug":"ubicacion","children":[]}],"git":{"createdTime":1683130897000,"updatedTime":1683130897000,"contributors":[{"name":"yamelsenih","email":"ysenih@erpya.com","commits":1}]},"readingTime":{"minutes":2.55,"words":764},"filePathRelative":"docs/master-data/warehouse.md","localizedDate":"May 3, 2023"}')}}]);